import styled from "styled-components";

const FilterContainer = styled.div`
    margin-bottom: 56px;

    h3 {
        font-size: 16px;
        font-weight: bold;
    }
`;

const Filter = () => {
    return (
        <FilterContainer>
            <h3>Filter by Alliances</h3>
        </FilterContainer>
    );
};

export default Filter;
